export function createState(inParentComponent: any) {

  return {
    currentView: "login",

    showRegister : function(): void {

      console.log("state.showAddContact()");

      this.setState({ currentView : "register"});

    }.bind(inParentComponent), /* End showAddContact(). */
  };

}
